			&::before {
				content: '';
				width: 24px;
				height: 4px;
				position: absolute;
				left: 0;
				top: 0.8125rem;
				box-shadow: 0 -7px $text, 0 7px $text;
				background-color: $text;

				transition: transform 0.2s, box-shadow 0.2s;
			}
	}


	@media screen and (max-width: 1200px) {
